    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col0 / col1 * 11 * col2 * - 52 BETWEEN + + col1 AND + 16 * - col2;
  - name: tab2

outputs:
  - name: q4620.out
    data: |
      46	51	23
      64	77	40
      75	67	58
